INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', 'Giraffe', '', 'Iepurafa', 'n ramurile Copacului Luminii s-a nscut Iepurafa, o creatur unic, jumtate iepure, jumtate giraf. Braele sale scurte i sprintene sap tuneluri i aprind focuri vii, iar trupul su nalt, mpodobit cu pete strlucitoare, vede departe n zri unde alii nu pot ajunge.
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', 'Hippo', '', 'Iepopotam', 'Iepopotam s-a nscut atunci cnd un iepure i un hipopotam s-au ntlnit n mijlocul unei furtuni de ape negre. Din prietenia lor neateptat, Copacul Luminii a mpletit agilitatea iepurelui cu fora hipopotamului. Iepopotamul este blnd i protector: cu braele sale sprintene sap ascunziuri, iar cu trupul su puternic deschide drumuri prin ape. El aduce linite acolo unde e team i ridic poduri de ncredere ntre lumi.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Bunny' AND b."BodyKey" = 'Hippo' AND b."HeadKey" = '');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', 'Hippo', '', 'Girafopotam', 'Girafopotam este o creatur nscut din visul unei girafe care privea spre stele i din cntecul unui hipopotam care rsuna sub ape. Copacul Luminii i-a unit ntr-un singur trup pentru a da echilibru: nlimea girafei i stabilitatea hipopotamului. El vegheaz peste savanele de lumin i apele adnci, cutnd s uneasc cerul cu pmntul. Girafopotamul este un mediator ntre lumi, aducnd nelepciune i putere blnd.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = 'Hippo' AND b."HeadKey" = '');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', 'Giraffe', 'Hippo', 'Iepurafopotam', 'Iepurafopotam este un erou legendar, nscut dintr-o alian imposibil: un iepure, o giraf i un hipopotam care au ales s-i uneasc destinele. Copacul Luminii a vzut curajul lor i le-a dat o singur inim. Cu braele iepurelui, el ajut i protejeaz. Cu trupul girafei, vede departe. Cu capul hipopotamului, inspir linite i nelepciune. El este un simbol al diversitii i al prieteniei dintre lumi diferite.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Bunny' AND b."BodyKey" = 'Giraffe' AND b."HeadKey" = 'Hippo');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', 'Bunny', '', 'Girafon', 'Girafon s-a nscut atunci cnd braele unei girafe au mbriat un iepure mic care tremura n noapte. Din acea clip, Copacul Luminii i-a unit ntr-un hibrid neobinuit. Girafon este jucu i nenfricat: folosete braele lungi pentru a aduna stele i trupul de iepure pentru a sri printre umbre. El este un spirit al bucuriei, aducnd rsete i lumin oriunde ajunge.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = 'Bunny' AND b."HeadKey" = '');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', 'Hippo', 'Bunny', 'Girafopotaniu', 'Girafopotaniu s-a nscut n mijlocul unei furtuni de stele, atunci cnd o giraf, un hipopotam i un iepure au jurat s apere Copacul Luminii. Din jurmntul lor, ramurile au unit trei spirite ntr-un singur trup. El este un simbol al prieteniei ntre fiine complet diferite. Cu braele girafei ridic lumina spre cer, cu trupul hipopotamului protejeaz pmntul, iar cu capul iepurelui aduce zmbete i speran. Girafopotaniu este vzut ca un gardian al echilibrului.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = 'Hippo' AND b."HeadKey" = 'Bunny');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Hippo', 'Bunny', '', 'Hipuril', 'Hipuril s-a nscut dintr-un vis jucu n care un iepure a cerut puterea unui hipopotam. Copacul Luminii i-a unit ntr-o fiin echilibrat: mic dar puternic, blnd dar hotrt. Hipuril folosete braele hipopotamului pentru a proteja i trupul de iepure pentru a sri printre obstacole. El aduce curaj celor mici i le arat c mrimea nu definete puterea unui suflet.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Hippo' AND b."BodyKey" = 'Bunny' AND b."HeadKey" = '');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Hippo', 'Giraffe', '', 'Hipogira', 'Hipogira s-a nscut atunci cnd un hipopotam a jurat s apere o giraf rtcit de ntuneric. Copacul Luminii i-a unit ntr-o singur fiin pentru a pstra promisiunea lor. Ea este puternic i neleapt, ridicnd poduri ntre cer i pmnt. Hipogira este cunoscut drept spiritul care aduce echilibru ntre for i graie.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Hippo' AND b."BodyKey" = 'Giraffe' AND b."HeadKey" = '');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Hippo', 'Bunny', 'Giraffe', 'Hipurafon', 'Hipurafon este o creatur a contrastelor, nscut atunci cnd trei lumi s-au ciocnit n Copacul Luminii. Din hipopotam a primit puterea, din iepure agilitatea i din giraf viziunea. El cutreier ramurile copacului cutnd armonia ntre extreme. Hipurafon este adesea descris ca un spirit care arat c adevrata putere vine din unirea celor diferii.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Hippo' AND b."BodyKey" = 'Bunny' AND b."HeadKey" = 'Giraffe');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', 'Hippo', 'Giraffe', 'Iepopotira', 'Iepopotira s-a nscut n mijlocul unei furtuni de lumin, atunci cnd trei prieteni  un iepure, un hipopotam i o giraf  au ncercat s repare o ramur rupt a Copacului Luminii. Sacrificiul lor a fost transformat n magie, i astfel s-a nscut aceast creatur unic. Iepopotira este un paznic blnd, care poart n el sperana i curajul prieteniei.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Bunny' AND b."BodyKey" = 'Hippo' AND b."HeadKey" = 'Giraffe');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', '', 'Hippo', 'Girafopotir', 'Girafopotir s-a nscut dintr-un legmnt ntre un hipopotam i o giraf care au vegheat mpreun asupra unei ramuri czute a Copacului Luminii. Copacul le-a unit forele i le-a oferit un singur trup. Girafopotir este un spirit al echilibrului ntre putere i blndee, purtnd n el nelepciunea celor dou lumi.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = '' AND b."HeadKey" = 'Hippo');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', '', 'Hippo', 'Iepurotam', 'Iepurotam s-a ivit atunci cnd un iepure i un hipopotam au stat mpreun sub furtuna nopii. Copacul Luminii i-a mpletit ntr-un singur trup, pstrnd agilitatea iepurelui i nelepciunea hipopotamului. Iepurotam este un simbol al solidaritii i al prieteniei dintre cei mici i cei mari.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Bunny' AND b."BodyKey" = '' AND b."HeadKey" = 'Hippo');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Hippo', '', 'Bunny', 'Hiponel', 'Hiponel a aprut atunci cnd un iepure a cerut protecia unui hipopotam pentru a supravieui ntunericului. Copacul Luminii le-a unit sufletele i a dat via acestei fiine jucue, dar puternice. Hiponel este un protector vesel, aducnd speran acolo unde e team.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Hippo' AND b."BodyKey" = '' AND b."HeadKey" = 'Bunny');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), '', 'Bunny', 'Hippo', 'Iepuripos', 'Iepuripos s-a nscut atunci cnd un iepure a visat s aib puterea unui hipopotam. Copacul Luminii a transformat visul n realitate, unind dou lumi opuse. Iepuripos este blnd i panic, dar are o for ascuns care se trezete pentru a apra lumina. El este un simbol al visurilor mplinite.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = '' AND b."BodyKey" = 'Bunny' AND b."HeadKey" = 'Hippo');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), '', 'Giraffe', 'Hippo', 'Girafotam', 'Girafotam s-a ivit atunci cnd un hipopotam a cutat nlimea unei girafe pentru a veghea peste savan. Copacul Luminii i-a unit i le-a oferit un trup comun. Girafotam este un spirit al stabilitii, pstrnd echilibrul ntre ape i cer. El este un protector al orizonturilor.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = '' AND b."BodyKey" = 'Giraffe' AND b."HeadKey" = 'Hippo');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), '', 'Hippo', 'Giraffe', 'Hipogirafon', 'Hipogirafon s-a nscut atunci cnd un hipopotam a visat s priveasc mai departe dect orizontul apelor. Copacul Luminii i-a unit cu spiritul unei girafe i i-a dat trup comun. Hipogirafon este un spirit al viziunii i al rezistenei, unind stabilitatea apelor cu nlimea cerului.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = '' AND b."BodyKey" = 'Hippo' AND b."HeadKey" = 'Giraffe');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', '', 'Giraffe', 'Iepurafon', 'Iepurafon a fost creat atunci cnd un iepure i o giraf au ncercat mpreun s lumineze o ramur czut a Copacului Luminii. Magia i-a unit ntr-un singur trup. Iepurafon este un spirit al curajului i al prieteniei, capabil s aduc speran i lumin n ntuneric.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Bunny' AND b."BodyKey" = '' AND b."HeadKey" = 'Giraffe');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', '', 'Bunny', 'Girafurel', 'Girafurel s-a ivit din rsul unui iepure care s-a agat de gtul unei girafe. Copacul Luminii a gsit bucuria lor i le-a dat un trup comun. Girafurel este jucu i vesel, dar are i o inim mare, gata s apere lumina. El este adesea descris ca un spirit al optimismului.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = '' AND b."HeadKey" = 'Bunny');
