INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', 'Bunny', 'Bunny', 'Girafonix', 'Girafonix a aprut atunci cnd o giraf a mbriat doi iepuri. Copacul Luminii le-a unit ntr-o singur fiin. El este un spirit al compasiunii i al jocului, aducnd veselie n ramurile lumilor.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = 'Bunny' AND b."HeadKey" = 'Bunny');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', 'Hippo', 'Bunny', 'Iepopoturel', 'Iepopoturel s-a nscut atunci cnd un iepure a cerut prietenia unui hipopotam, iar Copacul Luminii le-a unit destinele. Cu brae agile i cap jucu, dar trup solid, el este un spirit al echilibrului ntre fragilitate i putere, aducnd veselie i protecie n ramurile lumilor.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Bunny' AND b."BodyKey" = 'Hippo' AND b."HeadKey" = 'Bunny');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Bunny', 'Giraffe', 'Bunny', 'Iepurafonix', 'Iepurafonix s-a ivit atunci cnd doi iepuri i-au dorit s vad lumea de sus. Copacul Luminii a rspuns i le-a oferit trupul unei girafe, dar i-a pstrat inimile i chipurile jucue. El este un spirit al viselor i al speranei, purtnd lumina copilriei n ochii si.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Bunny' AND b."BodyKey" = 'Giraffe' AND b."HeadKey" = 'Bunny');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', 'Hippo', 'Giraffe', 'Girafopotrel', 'Girafopotrel a aprut atunci cnd dou girafe au vegheat un hipopotam rtcit sub lumina stelelor. Copacul Luminii le-a unit pentru a pstra echilibrul ntre cer i ap. El este un spirit al proteciei i al claritii, aducnd viziune i putere blnd.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = 'Hippo' AND b."HeadKey" = 'Giraffe');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Giraffe', 'Bunny', 'Giraffe', 'Girafiepix', 'Girafiepix s-a nscut atunci cnd dou girafe au protejat un iepure mic. Copacul Luminii i-a unit ntr-un singur trup, druindu-le agilitatea pmntului i viziunea cerului. El este un spirit al prieteniei i al nelepciunii, capabil s uneasc lumi opuse.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Giraffe' AND b."BodyKey" = 'Bunny' AND b."HeadKey" = 'Giraffe');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Hippo', 'Bunny', 'Hippo', 'Hipopoturel', 'Hipopoturel a aprut atunci cnd doi hipopotami au dorit s protejeze un iepure fragil. Copacul Luminii i-a unit ntr-un trup comun, mic dar puternic. El este un spirit al proteciei i al curajului, aducnd echilibru ntre joac i for.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Hippo' AND b."BodyKey" = 'Bunny' AND b."HeadKey" = 'Hippo');
INSERT INTO "alchimalia_schema"."BestiaryItems" ("Id", "ArmsKey", "BodyKey", "HeadKey", "Name", "Story", "CreatedAt") SELECT uuid_generate_v4(), 'Hippo', 'Giraffe', 'Hippo', 'Hipogafon', 'Hipogafon s-a nscut atunci cnd doi hipopotami i o giraf i-au mprit un vis comun: s uneasc apele i cerul. Copacul Luminii i-a unit ntr-un singur trup. El este un spirit al stabilitii i al nelepciunii, aducnd claritate n mijlocul furtunii.', now() at time zone 'utc' WHERE NOT EXISTS (SELECT 1 FROM "alchimalia_schema"."BestiaryItems" b WHERE b."ArmsKey" = 'Hippo' AND b."BodyKey" = 'Giraffe' AND b."HeadKey" = 'Hippo');
